dir_pin: !PE5
enable_pin: !PC14
microsteps: 16
rotation_distance: 40
endstop_pin:  ^EBBCan: PB6
position_endstop: 265
position_min: -5
position_max: 265
homing_speed: 300

[tmc2209 stepper_x]
uart_pin: PC13
##diag_pin: PF4 
run_current: 1.2
stealthchop_threshold: 999999


## Y Stepper on MOTOR1 (A Motor)
